@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("ecosia.org") {
    html {
        font-size: 1.2em;
        line-height: 1.5;
    }
    body, .body-index, .result-wrapper{
        background: #1e1e1e;
    }
    button, html, input, select, textarea{
        color: #eff1f2 !important;
    }
    .search-form-button{
        background-color: #2a2a2a;
    }
    #filtersButton{
        border: 0;
        border-radius: 0;
        background-color: #222;
    }
    #filtersButton.inversed{
        background-color: #11c8db !important;
        color: #181818 !important;
    }
    .search-form-input,
    .result-wrapper .search-form-input{
        background-color: #2a2a2a;
        border-color: #1a1a1a;
        border-radius: 0
    }
    .typeahead{
        background-color: #2a2a2a;
        border-color: #1a1a1a;
        border-radius: 0 !important;
        box-shadow: 0 5px 10px rgba(0,0,0, .1)
    }
    .typeahead li.active,
    .typeahead li:active,
    .typeahead li:hover{
        background-color: #1a1a1a;
    }

    .typeahead-suggestion:not(:last-of-type){
        border-color: transparent;
    }

    .typeahead-link{
        color: #eff1f2 !important;
        padding: 10px 15px
    }


    .tree-counter-text{
        background-color: #ef5c5c;
        border-color:transparent;
        font-weight: 600
    }

    .popover{
        background-color: #2a2a2a;
        border-color: transparent;
        border-radius: 0;
        box-shadow: 0 5px 10px rgba(0,0,0, .1);
        color : #eff1f2
    }
    .message .popover-arrow, .popover-arrow{
        background-color: #2a2a2a;
        border-color: transparent;
        border-radius: 0;
    }
    .popover-headline{
        color: #11c8db
    }



    #post-info, #header, .search-header, .search-header + .row, .navbar-row{
        background-color : #181818
    }
    .navbar-row, .result-wrapper .search-form-input{
        box-shadow: none
    }
    .navbar-link{
        padding: 7px 13px 5px
    }
    .navbar-link,
    .navbar-link:active,
    .navbar-link:hover,
    .navbar-link:visited{
        color : #bac0c0 !important;
    }

    .navbar-item-active > .navbar-link{
        color : #11c8db !important;
    }

    .nav-link, .nav-link:visited{
        color : #eff1f2 !important;
    }

    .nav-item-button .nav-link{
        background-color: #2a2a2a !important;
        border-color: transparent !important;
        border-radius: 0;
    }
    .nav-link.inversed{
        background-color: #11c8db !important;
    }
    .card-desktop{
        border-top-width: 2px;
        border-color: #181818 !important;
        padding-top: 30px
    }
    .disclaimer{
        border-top: 2px solid #181818;
        color: #cba800
    }
    .result-metadata,
    .result-snippet{
        color: #bac0c0 !important;
    }

    .search-filters-text{
        color: #ef5c5c !important;
    }
    .gs-visibleUrl, .gs-visibleUrl:active, .gs-visibleUrl:hover, .gs-visibleUrl:visited,    .result-url, .result-url:active, .result-url:hover, .result-url:visited {
        color: #6da27e;
    }
    .gs-title, .gs-title:hover, .result-title, .result-title:hover {
        color: #7ab6ff;
    }
    .gs-title, .gs-title:visited, .result-title:visited{
        color : #777777 !important;
    }
    .result {
        padding-bottom: 20px
    }



    .dropdown{
        background-color:  #181818;
        border-color: transparent;
        color: #eff1f2
    }
    .dropdown-menu{
        background-color: #2e2e2e;
    }
    .dropdown-link{
        color: #eff1f2 !important;
    }
    .dropdown-item:hover{
        background-color: #11c8db;
    }

    /* Pagination */
    .active.gsc-cursor-page, .pagination-button.active{
        background-color: #11c8db !important;
        color: #fff;
        font-weight: 600
    }

    .gsc-cursor-page, .pagination-button{
        background-color: #171717;
        color: #bac0c0;
        box-shadow: none !Important;
        transition: all .2s
    }
    .gsc-cursor-page:hover, .pagination-button:hover{
        background-color: #171717;
        color: #fff;
        transition: all .2s
    }



    .image-preview-headline{
        color: #cba800
    }
    .image-preview-link{
        border-color: transparent;
        border-radius: 0;
        background-color: #1a1a1a
    }

    .image-preview-link:hover,
    .image-preview-link:active{
        background-color: #11c8db;
        transition: all .3s
    }

    /*ABOUT*/
    .jobs{
        background-color: #333
    }
    .timeline-phase-headline{
        color: #11c8db
    }
    .container-contact .h2, .container-contact .text-intro,
    .timeline-phase-desc, .team .h2, .team .text-intro{
        color: #bac0c0
    }
    .timeline-header .h3, .team-member-name{
        color: #fff
    }
    .newsletter-about {
        background: rgba(0, 0, 0, 0) linear-gradient(to right bottom, #323232 50%, #242526 50%) repeat scroll 0 0;
    }
    /*INFO PAGE*/
    .hero-about, .media{
        background-color: #333
    }
    .how-it-works .h2{
        color: #fff
    }
    .step-text{
        color: #bac0c0
    }
    .project-wrapper{
        background-color: #222;
        color: #bac0c0
    }
    .install .h2, .install .text-intro,
    .report-details-text,
    .reports-container .description .h3, .reports-container .description .text-intro,
    .reports-container .h2,
    .snapshots .h5, .snapshots .project-snapshots-text, .snapshots .report-details-text,
    .snapshot-headline, .snapshot-text,
    .project-intro .h2, .project-intro .text-intro,
    .snapshots-description .h3, .snapshots-description .text-intro{
        color: #bac0c0
    }
    /*Settings*/
    select {
        position: relative;
        padding: 5px 2.5em 5px 10px;
        border: 1px solid #111;
        border-radius: 0;
        display: inline-block;
        -webkit-appearance: none;
        -moz-appearance: none;
        appearance: none;
        cursor: pointer;
        outline: none;
        vertical-align: middle;
    }
    .btn, .form-control-group .button{
        background-color: #333 !important;
        border: 0;
        color: #fff;
        border-radius: 0;
    }
    .btn.btn-primary, .btn.active, .form-control-group .button-primary, #pagination-post > a{
        background-color: #11c8db !important;
        border: 0;
        color: #fff
    }
    h1, h2, h3, h4, h5{
        color: #fff
    }
    hr{
        background-color: #222222 !important;
    }
    .entry .details{
        border-color: #222
    }
    .entry .details .tags a, .entry .read_more_container a{
        background-color: #11c8db;
        color: #fff;
        border-color: #111;
        border-width: 1px;
        border-radius: 0
    }
    #navigation #logo-image[src="http://i.imgur.com/ItvRMYf.png"]{
        display: block !important;
        height: 0 !important;
        padding: 25px 300px !important;
        margin-bottom: 10px;
        background: url(data:image/png;base64,) no-repeat !important;
    }
    #posts .entry, #sidebar{
        background-color : #181818
    }
    #avatar img{
        display: block;
        height: 0 !important;
        padding: 105px !important;
        background: url(data:image/png;base64,) no-repeat !important;
    }
}
